// Navbar.js
import React from 'react';
import CreateDeal from './Createdeal';



function Navbar2() {
  return (
    <nav>
      <button onClick={() => window.location.href = '/create-deal'}>Create Deal</button>
    </nav>
  );
}

export default Navbar2;
